import React, { Component } from "react";
import got1 from "../images/Got1.png";
export default class Categories extends Component {
  render() {
    return (
      <div style={{ marginTop: "74px" }}>
        <div class="text-center">
          <h2 style={{ fontSize: "41px" }}>Categories</h2>
        </div>
        <div class="container" style={{ paddingTop: "52px" }}>
          <div
            style={{
              display: "flex",
              justifyContent: "space-around",
              flexWrap: "wrap",
            }}
          >
            <div
              style={{ width: "375px", height: "250px", paddingRight: "50px" }}
              class="col-sm-9  col-md-6 col-lg-4 mt-sm-5 mt-5 mt-md-0 mt-lg-0"
            >
              <img
                src={got1}
                class="card-img-top"
                alt="..."
                style={{ borderRadius: "22.5px" }}
              />
              <div class="card-body">
                <h5
                  class="card-title text-center"
                  style={{ paddingTop: "10px" }}
                >
                  Card title
                </h5>
              </div>
            </div>
            <div
              style={{ width: "375px", height: "250px", paddingRight: "50px" }}
              class="col-sm-9  col-md-6 col-lg-4 mt-sm-5 mt-5 mt-md-0 mt-lg-0"
            >
              <img
                src={got1}
                class="card-img-top "
                alt="..."
                style={{ borderRadius: "22.5px" }}
              />
              <div class="card-body">
                <h5
                  class="card-title text-center "
                  style={{ paddingTop: "10px" }}
                >
                  Card title
                </h5>
              </div>
            </div>
            <div
              style={{ width: "375px", height: "250px", paddingRight: "50px" }}
              class="col-sm-9 col-md-6 col-lg-4 mt-sm-5 mt-5 mt-md-0 mt-lg-0 ml-sm-4 ml-4 ml-md-0 ml-lg-0"
            >
              <img
                src={got1}
                class="card-img-top"
                alt="..."
                style={{ borderRadius: "22.5px" }}
              />
              <div class="card-body">
                <h5
                  class="card-title text-center"
                  style={{ paddingTop: "10px" }}
                >
                  Card title
                </h5>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
